import React, { useState } from "react";
import "./Main.css";

function Main() {
  const [number1, setNumber1] = useState("");
  const [number2, setNumber2] = useState("");
  const [team1, setTeam1] = useState("red");
  const [team2, setTeam2] = useState("red");
  const [modifiers1, setModifiers1] = useState([""]);
  const [modifiers2, setModifiers2] = useState([""]);
  const [winner, setWinner] = useState("");

  const handleNumberChange = (e, setNumber) => {
    setNumber(e.target.value);
  };

  const handleTeamChange = (e, setTeam) => {
    setTeam(e.target.value);
  };

  const handleModifierChange = (index, value, setModifiers) => {
    setModifiers((modifiers) =>
      modifiers.map((modifier, i) => (i === index ? value : modifier))
    );
  };

  const handleAddModifier = (setModifiers) => {
    setModifiers((modifiers) => [...modifiers, ""]);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const num1 =
      parseFloat(number1) *
      modifiers1.reduce((acc, mod) => acc * parseFloat(mod || 1), 1);
    const num2 =
      parseFloat(number2) *
      modifiers2.reduce((acc, mod) => acc * parseFloat(mod || 1), 1);
    const result = num1 - num2;

    if (result > 0) {
      setWinner(`Team ${team1} wins!`);
    } else if (result < 0) {
      setWinner(`Team ${team2} wins!`);
    } else {
      setWinner("It's a tie!");
    }
  };

  return (
    <div className="App">
      <h1>Team Competition</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label>
            Number 1:
            <input
              type="number"
              value={number1}
              onChange={(e) => handleNumberChange(e, setNumber1)}
              required
            />
          </label>
          <label>
            Team 1:
            <select
              value={team1}
              onChange={(e) => handleTeamChange(e, setTeam1)}
            >
              <option value="red">Red</option>
              <option value="green">Green</option>
              <option value="blue">Blue</option>
            </select>
          </label>
          <div>
            {modifiers1.map((modifier, index) => (
              <div key={index}>
                <label>
                  Modifier {index + 1}:
                  <input
                    type="number"
                    step="0.01"
                    value={modifier}
                    onChange={(e) =>
                      handleModifierChange(index, e.target.value, setModifiers1)
                    }
                  />
                </label>
              </div>
            ))}
            <button
              type="button"
              onClick={() => handleAddModifier(setModifiers1)}
            >
              Add Modifier
            </button>
          </div>
        </div>
        <div>
          <label>
            Number 2:
            <input
              type="number"
              value={number2}
              onChange={(e) => handleNumberChange(e, setNumber2)}
              required
            />
          </label>
          <label>
            Team 2:
            <select
              value={team2}
              onChange={(e) => handleTeamChange(e, setTeam2)}
            >
              <option value="red">Red</option>
              <option value="green">Green</option>
              <option value="blue">Blue</option>
            </select>
          </label>
          <div>
            {modifiers2.map((modifier, index) => (
              <div key={index}>
                <label>
                  Modifier {index + 1}:
                  <input
                    type="number"
                    step="0.01"
                    value={modifier}
                    onChange={(e) =>
                      handleModifierChange(index, e.target.value, setModifiers2)
                    }
                  />
                </label>
              </div>
            ))}
            <button
              type="button"
              onClick={() => handleAddModifier(setModifiers2)}
            >
              Add Modifier
            </button>
          </div>
        </div>
        <button type="submit">Calculate Winner</button>
      </form>
      {winner && <h2>{winner}</h2>}
    </div>
  );
}

export default Main;
